export const setError=(user)=>({
    type: 'SET_ERROR',
    payload:user
})
export const setVerify=(user)=>({
    type: 'SET_VERIFICATION',
    payload: user
})
export const setUser=(user)=>({
    type: 'SET_USER',
    payload:user
})
export const setID=(user)=>({
    type:'SET_ID',
    payload:user
})
export const setTimeOut=(user)=>({
    type: 'TIMEOUT',
    payload:user
})
export const Email=(user)=>({
    type: 'EMAIL',
    payload:user
})
